using Microsoft.EntityFrameworkCore;
using CreeekRiver.Models;

public class CreekRiverDbContext : DbContext
{

    public DbSet<Reservations> Reservations { get; set; }
    public DbSet<UserProfile> UserProfiles { get; set; }
    public DbSet<Campsite> Campsites { get; set; }
    public DbSet<CampsiteType> CampsiteTypes { get; set; }

    public CreekRiverDbContext(DbContextOptions<CreekRiverDbContext> context) : base(context)
    {

    }

    protected override void OnModelCreating(ModelBuilder modelBuilder)
    {
        // seed data with campsite types
        modelBuilder.Entity<CampsiteType>().HasData(new CampsiteType[]
        {
        new CampsiteType {Id = 1, CampsiteTypeName = "Tent", FeePerNight = 15.99M, MaxReservationDays = 7},
        new CampsiteType {Id = 2, CampsiteTypeName = "RV", FeePerNight = 26.50M, MaxReservationDays = 14},
        new CampsiteType {Id = 3, CampsiteTypeName = "Primitive", FeePerNight = 10.00M, MaxReservationDays = 3},
        new CampsiteType {Id = 4, CampsiteTypeName = "Hammock", FeePerNight = 12M, MaxReservationDays = 7}
        });
        modelBuilder.Entity<Campsite>().HasData(new Campsite[]
        {
             new Campsite {Id = 1, CampsiteTypeId = 1, Nickname = "Barred Owl", ImageUrl="https://tnstateparks.com/assets/images/content-images/campgrounds/249/colsp-area2-site73.jpg"},
             new Campsite {Id = 2, CampsiteTypeId = 2, Nickname = " Bear", ImageUrl="data:image/jpeg;base64,"},
             new Campsite {Id = 3, CampsiteTypeId = 3, Nickname = " Gosoe", ImageUrl="data:image/jpeg;base64,"},
             new Campsite {Id = 4, CampsiteTypeId = 4, Nickname = " Frog", ImageUrl="data:image/jpeg;base64,"},
             new Campsite {Id = 5, CampsiteTypeId = 2, Nickname = "Worm", ImageUrl="data:image/jpeg;base64,"},
             new Campsite {Id = 6, CampsiteTypeId = 3, Nickname = " Snake", ImageUrl="data:image/jpeg;base64,"},

        });
        modelBuilder.Entity<UserProfile>().HasData(new UserProfile[]
        {
        new UserProfile {Id = 1, FirstName = "Jack", LastName = "Jones", Email = "jackiejones@hatermail.com"},
        });
        modelBuilder.Entity<Reservations>().HasData(new Reservations[]
        {
        new Reservations {Id = 1, CampsiteId = 1, UserProfileId = 1, CheckinDate = new DateTime(2023, 5, 25), CheckoutDate = new DateTime(2023, 5, 29)}
        });
        ;
    }




}